import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  BrowserRouter
} from 'react-router-dom';

import HomeFirst from './Pages/HomeFirst';
import Error404 from './Error404';

import About from '../src/components/About';
import Learn from './components/Mental_Health';
import Navigation from './components/Navigation';
const routePath = path => `${process.env.PUBLIC_URL + path}`;

const App = () => {
  return (
    <BrowserRouter>
      <div className='container'>
        <Navigation />
        <Switch>
          <Route path='/' component={HomeFirst} exact />
          <Route path='/about' component={About} exact />
          <Route path='/learn' component={Learn} exact />
          <Route path='/error404' component={Error404} exact />
        </Switch>
      </div>
    </BrowserRouter>
  );
};

export default App;
